import ActionType from "../../types/constant"
import timeAttendanceService from '../services/timeAttendanceService'

export const addPasswordDispatch = (pass: string) => {
    return {
        type: ActionType.ADD_PASSWORD,
        payload: pass
    }
}

export const resetPasswordDispatch = () => {
    return {
        type: ActionType.RESET_PASSWORD
    }
}

export const getEmployeeTimesDispatch = () => async (dispatch: any) => {
    try {
        dispatch(({
            type: ActionType.GET_EMPLOYEES_TIME_TODAY_START
        }))
        const result = await timeAttendanceService.getTimeOfEmpsToday()
        dispatch(({
            type: ActionType.GET_EMPLOYEES_TIME_TODAY_SUCCESS,
            payload: result.data
        }))
    } catch (err) {
        console.log('getEmployeeTimesDispatch err: ', err)
        dispatch(({
            type: ActionType.GET_EMPLOYEES_TIME_TODAY_ERROR,
            payload: err
        }))
    }
}

export const postTimeDispatch = (empId: string, ) => async (dispatch: any) => {
    try {
        dispatch(({
            type: ActionType.POST_EMPLOYEES_TIME_TODAY_START
        }))
        const result = await timeAttendanceService.postTimeOfEmpsToday()
        dispatch(({
            type: ActionType.POST_EMPLOYEES_TIME_TODAY_SUCCESS,
            payload: result.data
        }))
    } catch (err) {
        console.log('postEmployeeTimesDispatch err: ', err)
        dispatch(({
            type: ActionType.POST_EMPLOYEES_TIME_TODAY_ERROR,
            payload: err
        }))
    }
}
